import 'dart:io';

void main() {
  setUpAll(() {
    HttpOverrides.global = null;
  });

  testWidgets('Create', (widgetTester) async {
    await widgetTester.pumpWidget(const MaterialApp(home: CreatePage()));

    await widgetTester.pumpAndSettle();

    await widgetTester.drag(
        find.byType(SingleChildScrollView), const Offset(0, -350));

    await widgetTester.pumpAndSettle();

    final textFields = find.byType(TextField);

    expect(textFields, findsNWidgets(7));

    await widgetTester.enterText(textFields.at(0), 'Bali X');
    await widgetTester.enterText(textFields.at(1), 'Bali');
    await widgetTester.enterText(
        textFields.at(2), 'Bali is a beautiful island.');
    await widgetTester.enterText(textFields.at(3), '-1');
    await widgetTester.enterText(textFields.at(4), '1');
    await widgetTester.enterText(textFields.at(5), 'Premium');
    await widgetTester.enterText(textFields.at(6), '7');

    await widgetTester.drag(
        find.byType(SingleChildScrollView), const Offset(0, -500));

    expect(find.text('Create Destination'), findsOneWidget);
    await widgetTester.tap(find.text('Create Destination'));

    await widgetTester.pumpAndSettle();

    expect(find.text('Bali X'), findsOneWidget);
    expect(find.text('Bali'), findsOneWidget);
    expect(find.text('Bali is a beautiful island.'), findsOneWidget);
    expect(find.text('-1'), findsOneWidget);
    expect(find.text('1'), findsOneWidget);
    expect(find.text('Premium'), findsOneWidget);
    expect(find.text('7'), findsOneWidget);
  });

  testWidgets('Read', (widgetTester) async {
    final destinasiList = [
      Destinasi(
          id: 1,
          destinationName: 'Bali X',
          destinationAddress: 'Bali',
          destinationDescription: 'Bali is a beautiful island.',
          destinationLatitude: -1,
          destinationLongitude: 1,
          destinationImage:
              '',
          destinationCategory: '7',
          destinationRating: 5),
    ];

    await widgetTester.pumpWidget(MaterialApp(
        home: AttractionContainer(
      destinasiList: destinasiList,
    )));

    await widgetTester.pumpAndSettle();
    expect(find.text('Bali X'), findsOneWidget);
  });

